    [],nt"num_tags": 3,nt"name": "lake-ilo-national-wildlife-refuge-annual-narrative-report-calendar-year-1980",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lake Ilo
    NWR, White Lake NWR, Stewart Lake NWR, and Pretty Rock NWR outlines Refuge accomplishments
    during the 1980 calendar year. The report begins with an introduction to the Refuge
    and information about weather conditions, habitat conditions, land acquisition activities,
    and the system status. Maintenance is also described. Habitat management is covered;
    croplands and grasslands are discussed. The wildlife section of the report discusses
    migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include recreation. Field investigations, cooperative
    programs, items of interest, and safety information are attached.",nt"owner_org":
